import { useContext } from "react";
import { Link, useHistory } from "react-router-dom";
import { UserContext } from "../../Context/UserContext";
import styles from "./styles.module.scss";

export const Header = () => {
  const userContext = useContext(UserContext);
  const history = useHistory();
  const logout = () => {
    userContext.clearData();

    history.push("/");
  };
  return (
    <header className={styles.header}>
      <svg
        width="79"
        height="29"
        viewBox="0 0 571 199"
        fill="none"
        xmlns="http://www.w3.org/2000/svg"
        xmlnsXlink="http://www.w3.org/1999/xlink"
      >
        <rect width="571" height="199" fill="url(#pattern0)" />
        <defs>
          <pattern
            id="pattern0"
            patternContentUnits="objectBoundingBox"
            width="1"
            height="1"
          >
            <use
              xlinkHref="#image0"
              transform="translate(-0.259459 -1.85078) scale(0.00135135 0.00387597)"
            />
          </pattern>
          <image
            id="image0"
            width="1080"
            height="1080"
            xlinkHref="data:image/png;base64,"
          />
        </defs>
      </svg>

      {userContext.data.name.length > 0 && (
        <div>
          Bem vindo, {userContext.data.name} | <button onClick={logout}>Sair</button>
        </div>
      )}
    </header>
  );
};
